RULESCODE.Data:
Length EM_Outcome $24;
EM_Outcome = &quot;0&quot;;

IF House_Style IN (&quot;1.5Fin&quot;,&quot;1.5Unf&quot;,&quot;1Story&quot;) THEN DO;
   EM_Outcome = &quot;Smaller_Houses&quot;;
END;
ELSE IF SalePrice &lt; 120000.0 THEN DO;
   EM_Outcome = &quot;Cheap Smaller Houses&quot;;
END;
ELSE IF SalePrice &gt; 200000.0 THEN DO;
   EM_Outcome = &quot;Expensive_Smaller_Houses&quot;;
END;
ELSE IF House_Style NOT IN (&quot;1.5Fin&quot;,&quot;1.5Unf&quot;,&quot;1Story&quot;) THEN DO;
   EM_Outcome = &quot;Larger_Houses&quot;;
   IF SalePrice &lt; 150000.0 THEN DO;
      EM_Outcome = &quot;Cheap_Larger_Houses&quot;;
   END;
END;
ELSE IF SalePrice &gt; 300000.0 THEN DO;
   EM_Outcome = &quot;Expensive_Larger_Houses&quot;;
END;

Length EM_Outcome $24;
EM_Outcome = &quot;None&quot;;
 
IF Neighborhood IN (&quot;CollgCr&quot;,&quot;IDOTRR&quot;,&quot;Landmrk&quot;,&quot;NAmes&quot;,&quot;SWISU&quot;) THEN DO;
   EM_Outcome = &quot;Good_Value_For_Money&quot;;
END;
ELSE IF Neighborhood NOT IN (&quot;CollgCr&quot;,&quot;IDOTRR&quot;,&quot;Landmrk&quot;,&quot;NAmes&quot;,&quot;SWISU&quot;) THEN DO;
   EM_Outcome = &quot;Not_Good_Value_For_Money&quot;;
END;
